import React from 'react';

const QuestionsBox = ({questions}) =>{
    return (
        <div>
            {
                questions.map(({question, answers, questionId}) => {
                    return(
                    <div>
                        <h3 key={questionId}>{question}</h3>
                        
                    </div>
                    )
                })
            }
        </div>
    )
}

export default QuestionsBox;
